import React, { Component } from 'react';
import { IoMdAddCircleOutline} from 'react-icons/io';

class ModuleList extends Component {
    render() { 
        return (
            <div className="wbdv-module-list col-sm-3">
                <div>
                    <ul className="list-group wbdv-module-item">
                        <li className="list-group-item wbdv-module-item-title">Module1-HTML <i
                                className="fa fa-times float-right"></i></li>
                        <li className="list-group-item active wbdv-module-item-title">Module2-CSS <i
                                className="fa fa-times float-right wbdv-module-item-delete-btn"></i>
                        </li>
                        <li className="list-group-item wbdv-module-item-title">Module2-JavaScript <i
                                className="fa fa-times float-right wbdv-module-item-delete-btn"></i>
                        </li>
                        <li className="list-group-item wbdv-module-item-title">Module3-React <i
                                className="fa fa-times float-right wbdv-module-item-delete-btn"></i></li>
                        <li className="list-group-item wbdv-module-item-title">Module4-Redux <i
                                className="fa fa-times float-right wbdv-module-item-delete-btn"></i></li>
                        <li className="list-group-item wbdv-module-item-title">Module5-Node.js <i
                                className="fa fa-times float-right wbdv-module-item-delete-btn"></i></li>
                        <li className="list-group-item wbdv-module-item-title">Module6-Express <i
                                className="fa fa-times float-right wbdv-module-item-delete-btn"></i></li>
                        <li className="list-group-item wbdv-module-item-add-btn"> 
                        <i className="fa fa-plus float-right"></i></li>
                    </ul>
                </div>
            </div>
          );
    }
}

export default ModuleList;
